              <Grid item xs>
                <Typography gutterBottom variant="subtitle1">
                  Standard license
                </Typography>
                <Typography variant="body2" gutterBottom>
                  Full resolution 1920x1080 • JPEG
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  ID: 1030114
                </Typography>
              </Grid>
          </Grid>
          </Grid>
          </Paper>
          </Grid>

          <Grid item xs={4} >
                <Paper className={classes.paper} spacing= {20}>          
                <Grid item xs={12} sm container className={classes.load}>
            <Grid item xs container direction="column" spacing={2}>
              <Grid item xs>
                <Typography gutterBottom variant="subtitle1">
                  Standard license
                </Typography>
                <Typography variant="body2" gutterBottom>
                  Full resolution 1920x1080 • JPEG
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  ID: 1030114
                </Typography>
              </Grid>
          </Grid>
          </Grid>
          </Paper>
          </Grid>

      </Grid>
      </div>


  );

}
